import './App.css';
import Counter from './components/counter/Counter'

function App() {
  return (
    <div className="App">
      <Counter />
      <Counter />
      <Counter />
      <PlayWithProps />
    </div>
  );
}

function PlayWithProps() {
  return (
    <div>Props</div>
  )
}

export default App;
